ely variable Open Source Software, and in particular since 2000 when it was launched as a license-free Web Content Management System, TYPO3 has gathered a vast community of enthusiastic fans. Thanks to its modular construction and ingenious programming, TYPO3 has been able to establish itself among software developers throughout the world, rapidly advancing to become the world’s most implemented Open Source Web Content Management System! \r \n Hundres of thousands of companies of all sizes have built their corporate websites on TYPO3. And while TYPO3 was initially a European phenomenon, most particularly in the German-speaking countries of Germany, Austria and Switzerland, the number of TYPO3 installations has recently been rapidly increasing in the USA and on other continents. \r \n  Some interesting global facts about TYPO3:    TYPO3 is already being used in more than 500,000 installations;  TYPO3 is supported in its ongoing development by the efforts of almost 100,000 developers around the world;  TYPO3 already exists in more than 30 language versions;  TYPO3 is supported by thousands of web development companies around the globe  50% of Germany’s DAX-indexed companies choose TYPO3;  An increasing percentage of Fortune 500 companies run on TYPO3;  TYPO3 has become the quasi-standard Web Content Management System for NGOs such as Unicef, Greenpeace, MSF and even the UNESCO;  TYPO3 has been installed by many of the world’s Universities, such as TU Eindhoven in the Netherlands, Creighton University, Omaha, Nebraska in the USA,  the Federal Institute of Higher Technology in Klagenfurt, Austria and the Technical University of Berlin;  TYPO3 is the choice of the German Federal Government’s online presence wherever a decision is made for Open Source CMS;  in a few short years, TYPO3 has become something of a reference CMS standard for small to medium-sized businesses and light industries.   Whether for companies, associations, institutions or administrations, TYPO3 empowers staff to do their own editing, maintenance or complete reworking of their websites, independent of time and place, enabling colleagues to work on their internet presence from separate locations.'),(17721842,'test.jpg   '),(27979961,'Tables ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise RTE table    Caption       Gebiet A    Gebiet B    Gebiet C        2008     							50.000     							50.000     							50.000      2009     							50.000     							50.000     							50.000         Table layout 1  \n				 \n					 Caption  \n					 \n							   \n							 Gebiet A \n							 Gebiet B \n							 Gebiet C \n					 \n					 \n					 \n					 \n							 2009 \n							 54.000 \n							 41.000 \n							 62.000 \n					   \n					 \n							 2007 \n							 50.000 \n							 35.000 \n							 62.400 \n					 \n					 \n							 2008 \n							 52.500 \n							 39.700 \n							 61.500 \n					  \n				     Table layout 2  \n				 \n					 \n							   \n							 Gebiet A \n							 Gebiet B \n							 Gebiet C \n					 \n					 \n							 2007 \n							 50.000 \n							 35.000 \n							 62.400 \n					 \n					 \n							 2008 \n							 52.500 \n							 39.700 \n							 61.500 \n					 \n					 \n							 2009 \n							 54.000 \n							 41.000 \n							 62.000 \n					 \n				     Table layout 3  \n				 \n					 \n							   \n							 Gebiet A \n							 Gebiet B \n							 Gebiet C \n					 \n					 \n							 2007 \n							 50.000 \n							 35.000 \n							 62.400 \n					 \n					 \n							 2008 \n							 52.500 \n							 39.700 \n							 61.500 \n					 \n					 \n							 2009 \n							 54.000 \n							 41.000 \n							 62.000'),(30069562,'Search ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic