e community, but the  IRC chat  is important, too. Here, people meet in cyberspace to help each other and discuss new development.  Get a login ASAP . \r \n The  TYPO3 Extension Repository (TER)  is the backbone of contribution. Extensions are a far-reaching concept allowing people to contribute everything from highly complex additions or modifications to TYPO3 to simple skins or documentation and tutorials. The TER also offer a possibility to not get lost in this huge project since you can clearly identify the parts of TYPO3 interesting to you and then communicate directly with people of similar interest. \r \n  TYPO3 Events \r \n Each year we meet in the real world on snowboards in the mountains of central Europe. This event is highly catalyzing for the events the rest of the year and it\'s highly recommended to participate. Don\'t be shy - go! \r \n In addition there are many other activies such as TYPO3 Conferences around the world, the TYPO3 Developer Days (a yearly event) as well as hundreds of TYPO3 Usergroups around the world.User groups are emerging in many places.  See this page for TYPO3 User Groups (TUGs).  TYPO3 lives of individuals initiatives so in addition there are many more events organized by groups of people, devleopers or companies working with TYPO3, watch out for those, since they keep the community spirit an experience.'),(93199155,'Welcome to TYPO3 ,This website is a default website setup for TYPO3. You can use it to demonstrate the basic features of the TYPO3 Content Management System, but you are also welcome to use it as a basis for your own website projects. Please have a look at how it works and how it is structured. In building this package, we have tried to combine a lot of best practices. Feel free to use these structures and use elements of it for your own way of working. ,typo3, introduction package, install, demo site, example setup Welcome to TYPO3   Diese Website dient der Pr?sentation der TYPO3 Testsite f?r das Content Management System (CMS) TYPO3.\r \n Do we have any encoding problems? ? ? ? ???\r \n Die TYPO3 Testsite ist bewusst einfach gehalten, um den Einstieg in TYPO3 zu erleichtern. Diese bietet somit die optimale Voraussetzung, um TYPO3 zu testen oder eine eigene Internetseite zu erstellen.\r \n Die TYPO3 Testsite ist kostenlos. ?ber eine Namensnennung und R?ckverlinkung w?rde ich mich sehr freuen.\r \n Hier geht es zum Download der  TYPO3 Testsite .     Test header    test content  test content  test content  test content  test content  test content \r \n   \n  test content  test content  test content  test content  test content  test content      TYPO3 Testsite      Kontakt   Bei Fragen, Hinweisen oder Anregungen nehmen Sie bitte mit uns  Kontakt  auf.'),(116404532,'Image groups ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise 6 images in 6 columns         Image 1 \r       Image 2 \r       Image 3 \r       Image 4 \r       Image 5 \r       Image 6             6 images in 4 columns            Image 1 \r       Image 2 \r       Image 3 \r       Image 4 \r         Image 5 \r       Image 6            6 images in 3 columns            Image 1 \r       Image 2 \r       Image 3 \r         Image 4 \r       Image 5 \r       Image 6            6 images in 2 columns            Image 1 \r       Image 2 \r         Image 3 \r       Image 4 \r         Image 5 \r       Image 6            Fixed height for images with different width-height ratio                                                 Fixed width for images with different width-height ratio                                                 Fixed width and \"no rows\"  flagged'),(116627476,'Text ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise 11/15/09  Texts written in the RTE (Rich Text Editor)   All functions can be configured individually for the editors.\r \n  Continuous text:  text, optional in  bold  or  italic  or in a combination of   bold and italic  . \r \n  Special characters can be used : @ © ® ¢ ¼ ½ ¾ § ± a² m³ Ω π µ γ β α H 2 O\r \n  Texts in foreign languages can be mixed on one page.   The font has to be installed on the device though:\r \n kyrillisch: Русская версия  chinesisch: 中文版 arabisch:  الْعَرَبيّة  \r \n Centered text \n Text justified right \n  Bulleted list:     first level   first level    second level  second level   third level  third level      Ordered list:     first level   first level    second level  second level   third level  third level      Indented paragraph:    Aenean ante elit, elementum et, varius ut, condimentum ut, sem. Aenean ante neque, imperdiet sed, ultricies vitae, aliquam dictum, arcu. Aenean arcu est, semper vitae, euismod quis, vehicula eu, risus.    Indented even more:     Donec dui mauris, vestibulum id, venenatis at, rhoncus ut, dui. Donec elit felis, rhoncus congue, posuere vel, aliquet at, massa. Donec justo est, bibendum non, volutpat sed, eleifend quis, risus.         You can insert  intern Links  (to pages within the website),  extern Links  (to extern websites) or   e-mail addresses  (onclick opens the e-mail client).'),(122144994,'The History ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise Great things take time!   TYPO3 is nothing new or specifically trendy like many other Open Source tools that have risen in popularity recently because they focus strongly on Web 2.0 or blogging. In fact TYPO3 is a fully grown-enterprise CMS that can be used for virtually anything on the net and features a large set of functionalities grown and improved in functionality over more than a decade. It has been widely adopted by companies of all sizes throughout the world and is an established standard throughout many universities, governments and organizations.  TYPO3\'s development was started from scratch by Kasper Skårhøj in 1997. The term \"Content Management\" was still widely unknown. As you can see by the huge amount of CMSes on the market today, the idea of content management was a straight forward solution to an emerging problem for the young internet - as websites grew and the complexity of them increased, the need for separation of design and content was inevitable. \r \n Over the last decade TYPO3 has grown more feature-rich and powerful to the point it is today, where we can call it close to being feature-complete. \r \n       A little anecdote about the name \"TYPO3\"   Its creator Kasper Skårhøj remembers it happening something like this…\r \n Back in the late 1990s, while still working on the initial version, he was looking for a name for the new software. At the time, the name “freestyle” appealed to him, but it posed some problems through its over-association with certain activities, products and trademarks. So the issue of naming stayed on the back burner for want of a better idea. \r \n Then, one Friday evening while he was alone in the building after hours entering code, a lapse of concentration resulted in Kasper inadvertently typing an error into the command line of his Linux server and accidentally deleting a whole week’s worth of programming. He recalls that feeling you get of a cold rush through your entire body, when you realize something dreadful has happened. Slowly he got up, walked to the other end of the room and sat down in the couch looking back across the office at the laptop perched innocently on his desk. \r \n He stayed like this for a while, just staring emptily out into the room. Then, after the initial shock had subsided he walked back, sat down and began to recreate the lost code. This went surprisingly quickly; as such things do when you have them fully worked out in your head. And it was during this new rush of adrenaline and the satisfaction that all was not actually lost that he began to put the incident into a better perspective. The recreated programming was going smoothly and cleanly, which made him wonder how ironic it would be if a typo ended up actually improving the product! It was this thought that first brought up the expression “typo” as a possible name. It seemed to fit especially well because a) “typo”, as in typography, had something to do with layout and content and b) “typo”, as in spelling mistake, now had a quirky share in the product’s history. The newborn child now had a name. \r \n Originally there were Typo versions 1, 2 and 2.5. But with the enduring success of version 3, which had branded itself more or less by default, a “3” was eventually appended to the product title. Since the launch of “TYPO3 version 4”, it has been finally settled that TYPO3 will remain as the product name for the version 4 and the version 5 issue and all future versions. So, TYPO3 it is … and TYPO3 it stays.'),(134246624,'Any language, any character   Skip to navigation  \r\n      Skip to content  \r\n   \r\n  \r\n  \r\n    \r\n        English    Deutsch    \r\n        Website    \r\n      \r\n       \r\n         \r\n         \r\n       \r\n      \r\n      \r\n       First Level Navigation \r\n          Welcome to TYPO3    Flexible layout    Extendible functionality    Any language, any character    News    We like feedback    \r\n      \r\n    \r\n    \r\n      \r\n       Second Level Navigati