 image processing (cropping, scaling, conversions, effects)  A Rich Text Editor (WYSIWYG)  Unlimited Versioning  History/Undo functionality  Complete design flexibility with independant output (XML, XHTML, Flash, etc.)  Frontend Editing    Some of the Enterprise class features include:    Advanced multi language functions and localization options  Backend: supports more than 30 languages, Frontend: as many as you like  Enterprise Digital Asset Management  Abstraction layer for connection to outside systems and databases  Create protected areas for Intranet/Extranet in minutes  Complete user-access management with granular rights and workflow processes  Intelligent extension framework for API-based development of extensions and functionalities     and any other feature you might name, TYPO3 most likely already has it and if its not part of the core, than it can certainly be integrated through one of the more than 4,000 extension available for free from the TYPO3 Content Repository.'),(146845407,'The Community ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise '),(157731686,'News ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise All news articles  \r\n \r\n\r\n	\r\n			 				\r\n			   \r\n				 11/16/09 \r\n				 Lorem ipsum dolor sit amet \n			   \r\n			    \r\n			    Vivamus elementum dui vitae turpis ultrices aliquam volutpat justo accumsan. Pellentesque quis ligula sed purus aliquam blandit. Aliquam quis mag