uction package, install, demo site, example setup, content management, enterprise '),(173470407,'Flexible layout   Text mit Bild 1      Bild im Text rechts            Das Inhaltselement \"Text mit Bild\" bietet verschiedene M?glichkeiten den Text und das Bild bzw. die Bilder zu positionieren. Hier ein Beispiel f?r \"Bild im Text rechts\".       Bild im Text links            Das Inhaltselement \"Text mit Bild\" bietet verschiedene M?glichkeiten den Text und das Bild bzw. die Bilder zu positionieren. Hier ein Beispiel f?r \"Bild im Text links\".'),(185924216,'File downloads ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise Download no icon, no filesize       test.pdf         Download with icon, no filesize            test.pdf         Download with icon and filesize            test.pdf    1.1 K       Download with icon, filesize and description            test.pdf   Description of the file   1.1 K       Download with preview, filesize and description            test.jpg   Description of the file   112 K'),(188989748,'Images with links ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise Click on image: large version in popup window           click on image shows large version \r         click enlarge     Setting a flag in click-enlarge activates this option.\r \n   \n   \n   \n   \n         Click on image: link to intern or extern page           click to startpage \r         click to typo3.org     A link can be added to each link. Enter the links into the input field and seperate them with a comma. The link can consist of a page id, a URL like www.domain.de   or an e-mail address.'),(190878933,'Customer login ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise You can now view the protected pages!   You are logged in, so you can now view the protected pages which you can find in the navigation menu on the left.'),(206124384,'Extending features ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise TYPO3 - 4,000 modules and counting...   TYPO3 is a very modular Content Management System. This means that it consists, on the one hand, of a Core Program (T3 Core), in which the most important functions are integrated, and, on the other, of so-called \"extensions\", with which the existing performance range of the basic TYPO3 configuration can be extended as desired. So if you are missing any functionality, you can build it with the TYPO3 Extension API, connect it via Typoscript to the core and ensure, that even with core updates, the extension will remain intact - a major benefit compared to other systems, were updates constantly require changes to the extensions.\r \n  We differentiate fundamentally between two types of extension:    Plug-ins are those extensions which call up functions in the TYPO3 Frontend   Modules are extensions which deploy additional TYPO3 Backend functions      The Extension Repository   The Extension Repository is a central server in which every single published TYPO3 extension is stored. This makes the TER (TYPO3 Extension Repository) the central resource for all T3 extensions, whether they are plug-ins for use in the T3 Frontend or modules for the T3 Backend. \r \n There are currently around 4,000 extensions stored in the TER, ready for downloading, including so-called \"shy extensions\", or system extensions, which can also be downloaded, installed and uninstalled. You can choose freely from this repository, when trying to find a solution that meets your needs and if you don\'t: Go ahead and build your first extension and contribute back to a great community.'),(210554717,'Any login page   '),(212302303,'404 ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise '),(212479328,'Customer login ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise Login to this website   You are currently not logged in. Visitors who have an account can login to the website to get access to protected pages and content on this website. \r \n By default this website has 2 user accounts installed which you can use to test this feature:\r \n Username: customer1 Password: customer1 This user has access to all protected content on the default site.\r \n Username: someone Password: someone This user only has access to the \'Any login page\'.\r \n Finally, this particular piece of text will disappear as soon as a visitor logs in. T