se web CMS to date (with over 500,000 implementations and counting...). \r \n A worldwide community of close to 100,000 enthusiasts help improve, maintain and develop this leading CMS solution and more than 1,000 registered TYPO3 consultancies offer services around and with TYPO3.'),(236810892,'Site map ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,Testseite Sitemap      Welcome to TYPO3    About TYPO3    The History    The Community    The Organization    The Features    TYPO3 Worldwide      Out-of-the-box    csc content elements    Headers    Text    Text and images    Images with links    Image groups    Image effects    Frames    Tables    Bulletlist    Forms    File downloads    Site map      Language & character      Extended functionality    News    We like feedback        Menu of subpages to these pages (with abstract)     Headers   Examples for headers in TYPO3   Text    Text and images    Images with links    Image groups    Image effects    Frames    Tables   Examples for different table layouts   Bulletlist    Forms    File downloads    Site map       Menu of subpages to these pages + sections        Section index (pagecontent w/Index checked)     RTE table    Table layout 1    Table layout 2    Table layout 3'),(239332432,'About TYPO3 ,This website is a default website setup for TYPO3. You can use it to demonstrate the basic features of the TYPO3 Content Management System, but you are also welcome to use it as a basis for your own website projects. Please have a look at how it works and how it is structured. In building this package, we have tried to combine a lot of best practices. Feel free to use these structures and use elements of it for your own way of working. ,typo3, introduction package, install, demo site, example setup TYPO3 - The Enterprise CMS   TYPO3 is a  free Open Source content management system  for enterprise purposes on the web and in intranets. It offers full flexibility and extendability while featuring an accomplished set of ready-made interfaces, functions and modules.  TYPO3 has increased in popularity significantly over the last 10 years, making it the most used enterprise web CMS to date (with over 500,000 implementations and counting...). \r \n A worldwide community of close to 100,000 entusiasts help improve, maintain and develop this leading CMS solution and more than 1,000 registered TYPO3 consultancies offer services around and with TYPO3.'),(242115520,'The Organization ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise The TYPO3 Association   In November 2004 a group of people from the TYPO3 community including Kasper Skårhøj and other long-term contributors prepared and founded a non-profit organisation called the TYPO3 Association. The main goal is to support core development on a more steady basis and improve the transparency and efficiency of various aspects of the TYPO3 project.   Goals and Objectives    Fostering development of TYPO3;   Organisation of events for the purpose of information and education of its members;   Supporting the adaption of international software standards within TYPO3;   Education and certification to ensure quality of service;  Communication with its members and the general public, to spread and further knowledge and proficiency for the usage of the TYPO3 software, especially by virtue of it’s project website;    Membership and Application  The TYPO3 Association has two types of members:   Members of the Steering Committee  Steering Committee members are people that have consistently worked for TYPO3 and are willing and able to attend general assemblies, where they have the exclusive right to vote and decide on the Associations future. Members of the Steering Committee are appointed on a basis of merit and need to be recommended by two existing members, or a fifth of the general assembly. Of course too many people have contributed to make them all Steering Committee members while still having the possibility to meet easily and take decisions swiftly. Consequently the goal is to have a representative group with a complete array of different perspectives.   Supporting Members  Supporting Membership is open to everyone, but requires formal application. The Association will provide an online application form and payment method of membership fees. Members are either people or companies and are required to endorse the goals and objectives of the Association through their actions.  All Members will be entitled to exclusively advertise their membership and thus support for TYPO3 following admission to membership.   Bodies and practical work  The Association consists of the following bodies:   Board  The board is the executive body taking care of daily administrative work and legal matters and accounting. Click for current members after the first election and details on tasks and responsibilities.   General Assembly  The GA is the highest authority and elects the board, controls their work and generally decides on all matters of importance in its annual meeting. It is open to all members, but only Steering Committee members have the right to vote. Click for details.   Committees  Committees are the groups that do the actual work when it comes to discussing the usage of funds, community communication, education, events and so forth. Legally they are appointed by the board and the GA and make recommendations, which are then executed by the board.        Questions and Participation  This Association has been founded hoping to help TYPO3 development and the overall good of the project. Many questions are still to be answered, but some already have been. Please click here for an FAQ.  If you want to help in any of the Committees and have time and knowledge to actively contribute, please contact participation@dont-want-spam.typo3.org telling us what you would like to do.'),(243776722,'TYPO3 Worldwide ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise The leading Open Source Enterprise CMS worldwide    In the years since 1997, when Kasper Skårhøj first developed his infinitely variable Open Source Software, and in particular since 2000 when it was launched as a license-free Web Content Management System, TYPO3 has gathered a vast community of enthusiastic fans. Thanks to its modular construction and ingenious programming, TYPO3 has been able to establish itself among software developers throughout the world, rapidly advancing to become the world’s most implemented Open Source Web Content Management System! \r \n Hundres of thousands of companies of all sizes have built their corporate websites on TYPO3. And while TYPO3 was initially a European phenomenon, most particularly in the German-speaking countries of Germany, Austria and Switzerland, the number of TYPO3 installations has recently been rapidly increasing in the USA and on other continents. \r \n TYPO3...    is already being used in more than 500,000 installations;  is supported in its ongoing development by the efforts of almost 100,000 developers around the world;  already exists in more than 30 language versions;  is supported by thousands of web development companies around the globe   And that´s why...    TYPO3 has become the quasi-standard Web Content Management System for NGOs such as Unicef, Greenpeace, MSF and even the UNESCO;  TYPO3 has been installed by many of the world’s Universities, such as TU Eindhoven in the Netherlands, Creighton University, Omaha, Nebraska in the USA,  the Federal Institute of Higher Technology in Klagenfurt, Austria and the Technical University of Berlin;  TYPO3 is the choice of the German Federal Government’s online presence wherever a decision is made for Open Source CMS;  50% of Germany’s DAX-indexed companies choose TYPO3;  An increasing percentage of Fortune 500 companies run on TYPO3;  in a few short years, TYPO3 has become something of a reference CMS standard for small to medium-sized businesses and light industries.   Whether for companies, associations, institutions or administrations, TYPO3 empowers staff to do their own editing, maintenance or complete reworking of their websites, independent of time and place, enabling colleagues to work on their internet presence from separate locations.'),(244852572,'The History ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise '),(249515596,'We like feedback ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise Kontakt und Impressum      IT-Bo.com   Daniel Stateczny\r \n Feldsieper Str. 132 D- 44809 Bochum\r \n Telefon: +49 (0) 234 / 589 13 37\r \n E-Mail:   d.stateczny@ remove-this. it-bo.com      Angaben gem?? ? 6 TDG und ? 10 Abs. 3 MDStV     Inhaltlich und redaktionell verantwortlich ist Daniel S